import React from 'react';
import "./App.css";

const Contact = (props) => {
    const inputStyle = {
        border: '2px solid red'
    }
    return (
        <input type="text"
            style={inputStyle}
            onChange={props.change}
            value={props.currentName}>
        </input>
    )
}
export default Contact;
